  return (
    <>
      {console.log(postData.split(/\<[^\>]+\>/g))}
      {postData.split(/\<[^\>]+\>/g).map((v) => {
        console.log(v);
        if (v.match(/\<[^\>]+\>/)) {
          return (
            <h3>{v}</h3>
          )
        }
        return v;
      })}
    </>
  )
}

export default PostCardContent;
